import React from 'react';

const Home: React.FC = () => {
  return (
    <div className="text-center">
      <h1 className="text-5xl font-bold text-purple-500 mb-4">Royal Data Analyst</h1>
      <p className="text-lg text-gray-500 mb-4">
        Introverted GenZ with a passion for data analysis
      </p>
      <p className="mt-4">
        Welcome to my professional website! 
        Hi, I’m Richard K, a passionate data professional with over ten years of experience in the industry. My career is rooted in transforming complex data into actionable insights, helping organizations optimize their operations, drive growth, and make data-driven decisions. I specialize in areas such as data analysis, machine learning, and predictive modeling, leveraging these skills to solve real-world problems in sectors like telecommunications, finance, and security.

        With a strong academic background and hands-on expertise, I have developed solutions like customer churn prediction models, implemented data warehouses, and led AI-driven decision-making initiatives. In addition to my technical work, I enjoy mentoring upcoming data professionals and contributing to the global conversation on data science through presentations and publications.

        Outside of work, I’m passionate about continuing education, particularly in the fields of artificial intelligence and machine learning. I also enjoy collaborating with interdisciplinary teams and fostering a data-driven culture within organizations.


        Explore my projects and feel free to reach out.
      </p>
    </div>
  );
};

export default Home;
